CREATE TABLE `a_page_views` (
  `pg_id` int(255) NOT NULL AUTO_INCREMENT,
  `pg_name` varchar(698) NOT NULL,
  `pg_visit_hash` varchar(698) NOT NULL,
  `pg_dnt` varchar(698) NOT NULL,
  `pg_v_valid` int(2) NOT NULL DEFAULT '1',
